import React from 'react';

class Sample extends React.Component {
    constructor() {
        super();
        this.state = {
            name: "Naveen",
            age: "28"
        }
    }
    render() {
        return (
            <p> Class one da vennai {this.props.naveen} - {this.state.name} - {this.state.age} </p>
        )
    }
}


export default Sample;
